      Dance_Party_extras_intro:
        markdown: |
          # Fortsett å danse

          I del 2 skal du lage ditt eget prosjekt. Det finnes ingen oppgaver her, istedenfor finner du en haug med prosjekter som viser ulike måter å skape mer komplekse dansefester.

          Du kan gjennomføre leksjonene i hvilken som helst rekkefølge. Flytt deg mellom leksjonene for å se hvordan noe ble gjort i en tidligere leksjon, eller for å kombinere ideer mellom de ulike prosjektene. Prøv ut alle prosjektene, finn dine favoritter og bruk tiden din på legge dem til for å skape ditt eget prosjekt.

          <a class="btn btn-large btn-primary next-stage submitButton pull-right">Fortsett</a>

