      Terminology Recap:
        content1: beskrivelse her
        markdown: |
          Meldingen kryptert ved hjelp av **Cæsar kode** er enkle å dekode, særlig ved bruk av utregnings verktøy. Nå som du har trent litt på å løse en alfabet skift koding ( rimelig enkelt, sant?), la oss prøve noe mer avansert.

          **Terminologi**
          * **Kryptere**- en prosess for å kode en melding for å holde en hemmelig, slik at kun "utvalgte" kan lese den.
          * **Dekryptere** - en prosess for å reversere kryptering, bruke hemmelige melding til å gjenskape den opprinnelige teksten.
          * **Shiffer** - en metode (eller algoritme) for å kryptere noe.
          * **Cesærs shiffer** - en krypterings måte som flytter alfabetet med bestemt antall bokstaver.
          * **Knekke kryptering** - Når du forsøker å løse en hemmelig melding *uten* å kjenne til alle shiffer detaljer, da forsøker du å **knekke** krypteringen.

          Klikk Neste for å se **Neste utfordring**...
